 page to the new title.\nBe sure to check for [[Special:DoubleRedirects|double]] or [[Special:BrokenRedirects|broken redirects]].\nYou are responsible for making sure that links continue to point where they are supposed to go.\n\nNote that the page will \'\'\'not\'\'\' be moved if there is already a page at the new title, unless it is empty or a redirect and has no past edit history.\nThis means that you can rename a page back to where it was renamed from if you make a mistake, and you cannot overwrite an existing page.\n\n\'\'\'Warning!\'\'\'\nThis can be a drastic and unexpected change for a popular page;\nplease be sure you understand the consequences of this before proceeding.\";'),('en','messages:movepagetalktext','s:247:\"The associated talk page will be automatically moved along with it \'\'\'unless:\'\'\'\n*A non-empty talk page already exists under the new name, or\n*You uncheck the box below.\n\nIn those cases, you will have to move or merge the page manually if desired.\";'),('en','messages:movearticle','s:10:\"Move page:\";'),('en','messages:moveuserpage-warning','s:132:\"\'\'\'Warning:\'\'\' You are about to move a user page. Please note that only the page will be moved and the user will \'\'not\'\' be renamed.\";'),('en','messages:movenologin','s:13:\"Not logged in\";'),('en','messages:movenologintext','s:81:\"You must be a registered user and [[Special:UserLogin|logged in]] to move a page.\";'),('en','messages:movenotallowed','s:41:\"You do not have permission to move pages.\";'),('en','messages:movenotallowedfile','s:41:\"You do not have permission to move files.\";'),('en','messages:cant-move-user-page','s:68:\"You do not have permission to move user pages (apart from subpages).\";'),('en','messages:cant-move-to-user-page','s:84:\"You do not have permission to move a page to a user page (except to a user subpage).\";'),('en','messages:newtitle','s:13:\"To new title:\";'),('en','messages:move-watch','s:33:\"Watch source page and target page\";'),('en